  false,\n\t\"url\": null,\n\t\"notes\": \"Physical, current, meteorological, and
  other data were collected from XBT casts, buoys, and other instruments from a World-Wide
  distribution. Data were collected from 29 July 2003 to 02 September 2003. Data were
  submitted by the Marine Environmental Data Service (MEDS) in support of the Array
  for Real-time Geostrophic Oceanography (Argo), the Gulf of Mexico NOAA/NMFS Ship
  of Opportunity (SOOP), and the Global Temperature-Salinity Pilot Project (GTSPP).
  Physical parameters include profiles of temperature and salinity. Current parameters
  include current direction and speed. Meteorological parameters include dry bulb
  temperature, wind speed, wind direction, relative humidity, and air pressure.\",\n\t\"owner_org\":
